    "df = pd.read_csv(\"Cleaned_Ecommerce_Data.csv\")\n",
    "\n",
    "# Initialize the Dashboard (2x2 Grid)\n",
    "fig, axes = plt.subplots(2, 2, figsize=(16, 12))\n",
    "sns.set_style(\"whitegrid\") # Sets a clean, professional background\n",
    "\n",
    "# --- CHART 1: Device Economics (Top-Left) ---\n",
    "# Purpose: Check if mobile users spend less than desktop users\n",
    "sns.boxplot(\n",
    "    data=df, \n",
    "    x='Device_Used_for_Shopping', \n",
    "    y='Purchase_Amount', \n",
    "    ax=axes[0, 0], \n",
    "    palette='coolwarm'\n",
    ")\n",
    "axes[0, 0].set_title('Spending Distribution by Device', fontsize=14)\n",
    "axes[0, 0].set_ylabel('Purchase Amount ($)')\n",
    "\n",
    "# --- CHART 2: The Loyalty Ladder (Top-Right) ---\n",
    "# Purpose: See if higher loyalty scores correlate with larger cart sizes\n",
    "sns.barplot(\n",
    "    data=df, \n",
    "    x='Brand_Loyalty', \n",
    "    y='Purchase_Amount', \n",
    "    ax=axes[0, 1], \n",
    "    palette='viridis', \n",
    "    errorbar=None # Removes error bars for a cleaner look\n",
    ")\n",
    "axes[0, 1].set_title('Average Spending by Loyalty Score (1-5)', fontsize=14)\n",
    "axes[0, 1].set_ylabel('Avg Purchase Amount ($)')\n",
    "axes[0, 1].set_ylim(200, 350) # Zoom in to highlight small differences\n",
    "\n",
    "# --- CHART 3: Education & Value (Bottom-Left) ---\n",
    "# Purpose: Check if education level drives spending\n",
    "# We define a logical order for the x-axis\n",
    "edu_order = [\"High School\", \"Bachelor's\", \"Master's\", \"PhD\"]\n",
    "\n",
    "sns.violinplot(\n",
    "    data=df, \n",
    "    x='Education_Level', \n",
    "    y='Purchase_Amount', \n",
    "    order=edu_order, \n",
    "    ax=axes[1, 0], \n",
    "    palette='muted'\n",
    ")\n",
    "axes[1, 0].set_title('Spending Distribution by Education Level', fontsize=14)\n",
    "axes[1, 0].set_ylabel('Purchase Amount ($)')\n",
    "\n",
    "# --- CHART 4: Category Demographics (Bottom-Right) ---\n",
    "# Purpose: Identify if certain categories skew towards older/younger shoppers\n",
    "# We filter for just the Top 5 categories to keep the chart readable (this can be adjusted accordingly to show all catagories)\n",
    "top_5_cats = df['Purchase_Category'].value_counts().head(5).index\n",
    "df_top_cats = df[df['Purchase_Category'].isin(top_5_cats)]\n",
    "\n",
    "sns.boxplot(\n",
    "    data=df_top_cats, \n",
    "    y='Purchase_Category', \n",
    "    x='Age', \n",
    "    ax=axes[1, 1], \n",
    "    palette='pastel'\n",
    ")\n",
    "axes[1, 1].set_title('Age Distribution of Top 5 Categories', fontsize=14)\n",
    "axes[1, 1].set_xlabel('Customer Age')\n",
    "\n",
    "# Finalize and Show\n",
    "plt.tight_layout()\n",
    "plt.savefig('habit_value_dashboard.png')\n",
    "plt.show()"
